import MethodPage from "../MethodPage/MethodPage";
import classes from "./SetPage.module.css";
import Sidebar from "../../components/Sidebar/Sidebar";
import { Fumen } from "../../components/Fumen/Fumen";
import SetChooser from "../../components/SetChooser/SetChooser";
import { useEffect } from "react";
import { useSidebar } from "../../contexts/SidebarContext";

interface SetPage {
    pc: number;
}


const SetPage = ({ pc }: SetPage) => {
    const { setSidebar } = useSidebar();
    document.title = `${pc}${
        ["", "st", "nd", "rd", "th", "th", "th", "th"][pc]
    } PC`;

    useEffect(() => {
        setSidebar(
            "Sets",
            <SetChooser />
        );
        // Only run when 'pc' changes
    }, [pc, setSidebar]);
    

    const seconds = [];
    for (let i = 0; i < 7; i++) {
        for (let j = i + 1; j < 7; j++) {
            for (let k = j + 1; k < 7; k++) {
                for (let l = k + 1; l < 7; l++) {
                    seconds.push(
                        "TIJLOSZ"[i] +
                            "TIJLOSZ"[j] +
                            "TIJLOSZ"[k] +
                            "TIJLOSZ"[l]
                    );
                }
            }
        }
    }

    return (
        <div className={classes.hi}>
            <Fumen fumen="v115@9gilwhDeR4glRpwhCeR4wwg0RpwhBeBtxwi0whCeBt?wwJeAgH"></Fumen>
            {seconds.map((second) => (
                <div className={classes.container}>
                    {second}
                </div>
            ))}
        </div>
    );
};

export default SetPage;
